CREATE DATABASE NBA;
USE NBA;
CREATE TABLE equipos (
  id_equipo INT,
  nombre varchar(20) NOT NULL,
  ciudad varchar(20) DEFAULT NULL,
  conferencia varchar(4) DEFAULT NULL,
  division varchar(9) DEFAULT NULL,
  pabellon varchar(50) DEFAULT NULL,
  capacidad BIGINT,
  puntos INT,
  pp INT,
  pg INT,
  PRIMARY KEY (id_equipo)
);

CREATE TABLE jugadores (
  codigo int NOT NULL,
  nombre varchar(30) DEFAULT NULL,
  procedencia varchar(20) DEFAULT NULL,
  altura INT DEFAULT NULL,
  peso int DEFAULT NULL,
  posicion varchar(5) DEFAULT NULL,
  equipo INT DEFAULT NULL,
  capitan INT DEFAULT NULL,
  salario FLOAT,
  PRIMARY KEY (codigo),
  FOREIGN KEY (equipo) References equipos(id_equipo)
);



CREATE TABLE estadisticas (
  temporada varchar(5) NOT NULL ,
  jugador int NOT NULL ,
  Puntos_por_partido float DEFAULT NULL,
  Asistencias_por_partido float DEFAULT NULL,
  Tapones_por_partido float DEFAULT NULL,
  Rebotes_por_partido float DEFAULT NULL,
  PRIMARY KEY (temporada,jugador),
  FOREIGN KEY (jugador) REFERENCES jugadores(Codigo)
)engine=innodb;


CREATE TABLE arbitros
(
   id_arbitro	INT,
   nombre	VARCHAR(40),
   apellidos	VARCHAR(50),
   antiguedad	INT,
   salario	FLOAT,
   PRIMARY KEY(id_arbitro)
);


CREATE TABLE partidos (
  codigo int NOT NULL,
  equipo_local INT DEFAULT NULL,
  equipo_visitante INT DEFAULT NULL,
  puntos_local int DEFAULT NULL,
  puntos_visitante int DEFAULT NULL,
  temporada varchar(5) DEFAULT NULL,
  arbitro INT,
  PRIMARY KEY (codigo),
  FOREIGN KEY (equipo_local) REFERENCES equipos(id_equipo),
  FOREIGN KEY (equipo_visitante) REFERENCES equipos(id_equipo),
  FOREIGN KEY (arbitro) REFERENCES arbitros(id_arbitro)
);


